export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},lMrlDL6bE0:{data:{id:2329,attributes:{imdbId:"tt1067583",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTQzMDU3NDEwN15BMl5BanBnXkFtZTcwMTI3MDU0NA@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"60%"},{Source:"Metacritic",Value:"52\u002F100"}],item_lang:{data:{id:2992,attributes:{title:d,plot:"After his parents' death, Jacob Jankowski is left penniless and homeless. Events lead him to joining the circus as their vet, working under their unstable boss August whose violent tendencies give everyone reason to be cautious around him, including his beautiful and quiet wife Marlena, whom August is very possessive of and who Jacob finds himself soon falling in love with.",slug:"water-for-elephants"}}},books:{data:[{id:11320,attributes:{title:d,description:"When Jacob Jankowski, recently orphaned and suddenly adrift, jumps onto a passing train, he enters a world of freaks, swindlers and misfits in a second-rate circus struggling to survive during the Great Depression. A veterinary student who almost earned his degree, Jacob is put in charge of caring for the circus menagerie.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0wc1mAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2011-01-01",publisher:f,subtitle:f}},{id:11321,attributes:{title:d,description:"Ninety-something-year-old Jacob Jankowski remembers his time in the circus as a young man during the Great Depression, and his friendship with Marlena, the star of the equestrian act, and Rosie, the elephant, who gave them hope. Reader's Guide included. Reprint.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sfC0p0Y9wY8C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2007-01-01",publisher:"Algonquin Books",subtitle:h}},{id:11322,attributes:{title:"The Sara Gruen Collection",description:"FROM INTERNATIONALLY-BESTSELLING AUTHOR SARA GRUEN, A COLLECTION OF HER MOST BELOVED NOVELS 'ONE OF AMERICA'S MOST COMPELLING STORYTELLERS' Kathryn Stockett, author of The Help 1 - WATER FOR ELEPHANTS The international phenomenon - with over 10 million copies sold, made into a film with Reese Witherspoon and Robert Pattinson. 'I loved Water for Elephants' Stephen King 'You are so immersed in circus life that you are blinded by the thrilling, fatal dazzle of sequins and sawdust' The Telegraph 'An imaginative modern fairy story, teeming with eccentric characters' The Times The Great Depression 1929 - when Jacob Jankowski, recently orphaned and suddenly adrift, jumps onto a passing train, he enters a world of freaks, grifters, and misfits in the Benzini Brothers Most Spectacular Show on Earth a second-rate travelling circus struggling to survive making one-night stands in town after endless town. He meets Marlena, the beautiful young star of the equestrian act, married to August, the charismatic but twisted animal trainer. He also meets Rosie, an elephant who seems untrainable until he discovers a way to reach her... 2 - AT THE WATER'S EDGE A gripping and poignant love story set in a remote village in the Scottish Highlands at the end of the Second World War. 'The only fault I can find with this book is that I've already finished it' Jodi Picoult 'Truly enthralling' Scotsman 'Breathtaking' Harper's Bazaar 1945. After disgracing themselves at a high society party, spoilt young Philadelphia socialites Maddie and Ellis Hyde are cut off from the family without a penny. Ellis decides their salvation will be to hunt down the Loch Ness Monster, a venture his father very publicly failed at. So, oblivious to WW2 raging around them, they make their way to the Scottish Highlands, where Maddie has to face reality and decide just who the real monsters are. 3 - APE HOUSE The New York Times bestseller. 'If you love animals like I do, it's a must read' Ellen DeGeneres 'Had me instantly enraptured' Dallas Morning News 'Wildly entertaining' Booklist (starred review) These bonobos are no ordinary apes. Like others of their species, they are capable of reason and carrying on deep relationships - but, unlike most bonobos, they also know American Sign Language. Isabel Duncan, a scientist at the Great Ape Language Lab, doesn't understand people, but animals she gets, especially the bonobos. Isabel feels more comfortable in their world than she's ever felt among humans . . . until she meets John Thigpen, a very married reporter who braves the ever-present animal rights protesters outside the lab to see what's really going on inside. When an explosion tears apart the lab, severly injuring Isabel and 'liberating' the apes to an unknown destination, John's human interest piece turns into the story of a lifetime.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sTcuDQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2016-10-10",publisher:"Hachette UK",subtitle:"Water for Elephants - At the Water's Edge - Ape House"}},{id:11323,attributes:{title:d,description:"Set in a travelling circus touring the backblocks of America during the Great Depression of the early 1930s this is a story of love and hate, trains and circuses, dwarves and fat ladies, horses and elephants - or to be more specific, one elephant, Rosie, star of Benzini Bros Most Spectacular Show on Earth . . . Now a major motion picture.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Chw0-w_Kr2kC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2011-05-01",publisher:"Allen & Unwin",subtitle:h}},{id:11324,attributes:{title:"Bookclub-in-a-box Presents the Discussion Companion for Sara Gruen's Novel Water for Elephants",description:"Running away with the circus is one of the world’s most enduring and romantic ideas. However, the reality of circus life during the Depression era was hard and painful. Jacob Jankowski, now over ninety years old, looks back on that time of desperation, cruelty and prejudice, but at the same time, he recalls a magical atmosphere, the animals, the larger-than-life circus population, love, and, of course, a special elephant named Rosie. Sara Gruen depicts a juxtaposed world of the train circus and the nursing home. The Bookclub-in-a-Box discussion guide for this marvelous novel will uncover the mystery of how to carry water for elephants. In addition, you will explore Gruen’s masterful story-telling techniques and how the worlds of aging and circus adventure intersect. Every Bookclub-in-a-Box discussion guide includes complete coverage of the themes and symbols, writing style and interesting background information on the novel and the author.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-YO3xKaIr00C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b,"Marilyn Herbert"],firstBook:e,published:"2008-01-01",publisher:"Bookclub-in-a-Box",subtitle:f}}]}}},meta:{}}},prerenderedAt:1694069454369}}("movie","Sara Gruen","series","Water for Elephants",null,"",1,"A Novel"))